import { Layout, Image, Row, Col, Avatar, Input, Button, List, Space, Checkbox, Card, Divider } from "antd";
import { SearchOutlined, EnvironmentFilled } from '@ant-design/icons';
import React from "react";
import { AxiosResponse } from "axios";
import axios from "axios";

interface MyLearningProps { }
interface MyLearningState {
    // data: any[];
    // pagination: any;
}

const { Header, Content } = Layout;
const { Search } = Input;

const dataList = [
    {
        title: "Accounting Staff",
        date: "Aug 21, 2021",
    },
    {
        title: "Human Resource Manager",
        date: "Jul 25, 2021",
    },
    {
        title: "Maintenance Supervisor",
        date: "Jun 21, 2021",
    },
    {
        title: "Marketing Manager",
        date: "Aug 2, 2021",
    },
    {
        title: "Business Consultant",
        date: "Jul 12, 2021",
    },
    {
        title: "Accounting Manager",
        date: "Jul 18, 2021",
    },
    {
        title: "Human Resource Manager",
        date: "Aug 23, 2021",
    },
    {
        title: "Art Director",
        date: "Jun 21, 2021",
    },
    {
        title: "Public Relations and Community Relations",
        date: "Sept 9, 2021",
    },
    {
        title: "Finance Manager",
        date: "Jul 18, 2021",
    },
    {
        title: "Maintenance Staff",
        date: "Sept 21, 2021",
    },
    {
        title: "Master of Ceremony",
        date: "Jul 18, 2021",
    },
    {
        title: "Business Analyst",
        date: "Jun 20, 2021",
    },
];

class MyLearning extends React.Component<MyLearningProps, MyLearningState>{
    state = {}
    // state = {
    //     data: [],
    //     pagination: {
    //         page: 1,
    //         total: 0,
    //     },
    // };
    // componentDidMount() {
    //     this.getData();
    // }

    // getData() {
    //     this.getMyLearningPagination(this.state.pagination).then((res: AxiosResponse<any>) => {
    //         this.setState({
    //             data: res.data.data,
    //             pagination: {
    //                 page: res.data.page,
    //                 total: res.data.total,
    //             },
    //         });
    //     });
    // }

    // getMyLearningPagination = (params: any) => {
    //     return axios.get(URL = "https://reqres.in/api/unknown", {
    //         params: params,
    //     });
    // }

    render() {
        return (
            <>
                <div>
                    <Layout className="mainLayout">
                        {/* Header */}
                        <Header className="mainHeader">
                            <Row justify="space-between">
                                <Col><Image
                                    preview={false}
                                    width={100}
                                    src="data:image/png;base64,"
                                />
                                </Col>
                                <Col>
                                    Hi, User <Avatar size="small" />
                                </Col>
                            </Row>
                        </Header>

                        {/* Content */}
                        <Content className="mainContent">
                            <Row>
                                <Col span={24}>
                                    <Row justify="space-between">
                                        <Col>
                                            <h3>My Learnings</h3>
                                        </Col>
                                        <Col>
                                            <Space>
                                                <Input className="searchBox" placeholder="Masukkan kata kunci" suffix={<SearchOutlined />} allowClear />
                                                <Button className="searchButton" type="primary">Search Class</Button>
                                            </Space>
                                        </Col>
                                    </Row>
                                    <Divider />
                                    <Row>
                                        <div className="buttonFilter">
                                            <Button size="small">
                                                All
                                            </Button>
                                            <Button size="small">
                                                Applied
                                            </Button>
                                            <Button size="small">
                                                On
                                                -Progress</Button>
                                            <Button size="small">
                                                Completed
                                            </Button>
                                            <Button size="small">
                                                Bookmark
                                            </Button>
                                        </div>
                                    </Row>
                                    <Row>
                                        <List style={{ width: "100%" }}
                                            itemLayout="horizontal"
                                            dataSource={dataList}
                                            renderItem={(item) => (
                                                <List.Item>
                                                    <Card className="cardContainer">
                                                        <Row gutter={[10, 0]}>
                                                            <Col span={4}>
                                                                <Image className="imagePreview"
                                                                    src="https://zos.alipayobjects.com/rmsportal/jkjgkEfvpUPVyRjUImniVslZfWPnJuuZ.png" />
                                                            </Col>
                                                            <Col span={20}>
                                                                <Row justify="space-between">
                                                                    <Col>
                                                                        <Space>
                                                                            <Button size="small">Training</Button>
                                                                            {item.title}
                                                                        </Space>
                                                                    </Col>
                                                                    <Col>
                                                                        123 participant
                                                                    </Col>
                                                                </Row>
                                                                <Divider />
                                                                <Row justify="space-between">
                                                                    <Col>
                                                                        <Row>
                                                                            <Col>
                                                                                Applied On
                                                                                <br />
                                                                                Posted On
                                                                                <br />
                                                                                Will Start On
                                                                                <br />
                                                                                Access Link
                                                                            </Col>
                                                                            <Col>
                                                                                :
                                                                                <br />
                                                                                :
                                                                                <br />
                                                                                :
                                                                                <br />
                                                                                :
                                                                            </Col>
                                                                            <Col>
                                                                                <span> </span>
                                                                                <br />
                                                                                <span> </span>
                                                                                <br />
                                                                                <span> </span>
                                                                                <br />
                                                                                <span> </span>
                                                                            </Col>
                                                                            <Col>
                                                                                20 minutes
                                                                                <br />
                                                                                {item.date}
                                                                                <br />
                                                                                {item.date}
                                                                                <br />
                                                                                link
                                                                            </Col>
                                                                        </Row>
                                                                    </Col>
                                                                    <Col>
                                                                        <Button disabled>Applied</Button>
                                                                    </Col>
                                                                </Row>
                                                            </Col>
                                                        </Row>
                                                    </Card>
                                                </List.Item>
                                            )}
                                        />
                                    </Row>
                                </Col>
                            </Row>
                        </Content>
                    </Layout>
                </div>
            </>
        );
    }
}

export default MyLearning;
